  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Bowdoin
  National Wildlife Refuge outlines Refuge accomplishments during the 1996 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  The report includes a planning section which discusses management plans and compliance
  with environmental mandates. Refuge administration is outlined; information about
  personnel, youth programs, volunteer programs, funding, safety, and technical assistance
  is given. Habitat management is also covered; subjects include wetlands, grasslands,
  other habitats, fire management, and pest control. The wildlife section of the report
  discusses wildlife diversity, endangered and threatened species, waterfowl, marsh
  birds and waterbirds, shorebirds, raptors, other migratory birds, game mammals,
  other resident wildlife, scientific collections, animal control, marking and bird
  banding, and disease prevention and control. The public uses of the Refuge described
  in this report include outdoor classrooms, interpretive programs, hunting, wildlife
  observation, and law enforcement. The equipment and facilities section of the report
  provides information about rehabilitation, major maintenance, equipment utilization
  and replacement, communications systems, computer systems, and energy conservation.
  Cooperative programs and other economic uses are discussed. A brief report on Black
  Coulee, Creedman Coulee, Hewitt Lake, Lake Thibadeau, Grassy Lake, and Mud Lake
  National Wildlife Refuges, and Bowdoin Wetland Management District is provided.
  Photographs and Refuge brochures are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
